"""Cette fonction nous sert à remplir les valeurs manquantes des différents champs. Nous avons bien conscience de sa compléxité (qui nous a d'ailleurs posée problème par la suite).

Elle a pour objectif d'effectuer une moyenne des valeurs alentours.
Prenons pour exemple la température. Imaginons que dans une base de donnée nous n'avons pas de valeur de température à un instant donné. Pour la compléter par une valeur conhérenté nous allons faire la moyenne des températures mesurées par les stations environnentes au même moment.
Nous prenons au maximum 5 valeurs que nous allons chercher dans un rayon maximum de 40km. Nous prenons évidemment en priorité les stations les plus proches.

C'est ici que nous avons rencontré un problème de bords, en effet lorsque que nous cherchons les voisins d'une base nous ne les trouverons que dans le rectangle rouge (df_idf) que nous avons vu précédemment. Le problème étant que parfois certaines stations sont plus proches mais, malheureusement, pas dans la zone délimitée. C'est pourquoi nous avons décidé d'étendre la zone de recherche des voisins avec le rectangle rouge(df_idf_large).
"""

def fill_missing_values (DataFrame1, column, DataFrame2) :

  dropNA_column = DataFrame1[DataFrame1[column].notna()]  #dropNA est la DataFrame entière sans les lignes où 'column' = NaN, on peut la créer avant la 1ère boucle for
  Distance_max = 40 # nous estimons qu'au delà d'un rayon de 40km, les valeurs environnantes ne sont plus pertinantes pour l'interpolation.

  for i in list(DataFrame1[column].index.values): #i parcourt la dataframe test
    if math.isnan(DataFrame1[column][i]) == True : #Si la valeur de 'dd' est "NaN"
      proches_i = [] #création de la liste des directions de vents proches de notre i
      Distance=5  #nous initialisons notre rayon de recherche à 5km pour l'interpolation
      newlist1=[]
      meme_date_i = dropNA_column[dropNA_column['date'] == DataFrame1['date'][i]] #DataFrame sans les lignes où dd=NaN, contenant seulement les lignes où date = date de l'indice i
      while len(newlist1)<=5 and Distance <= Distance_max:
        for j in list(meme_date_i.index.values): #on parcourt la df à la meme date que i sans les NaN
          distance_avec_sation_i = geopy.distance.geodesic((DataFrame1['lat'][j],DataFrame1['lon'][j]),(DataFrame1['lat'][i],DataFrame1['lon'][i])).km
          if (Distance-5 < distance_avec_sation_i <= Distance) : #Si le point est dans les 5km
            newlist1.append([distance_avec_sation_i,j])
        Distance+=5 #augmente la distance si on a pas atteint les 5 proches du while
      for q in range (0,len(newlist1)):
        proches_i.append(DataFrame1[column][(newlist1[q][1])]) #on remplit la liste proches_i à partir de "newlist1"
      if len(proches_i)!=0 :
        DataFrame1[column][i] = avg(proches_i)
  return (DataFrame1)

